import React from 'react'
import {NavLink} from "react-router-dom"
import { Button } from '../components/Button';
import styled from 'styled-components';

const Our_Aim = () => {
  return (
    <>
    <Wrapper>
        <div className='container'>
            <div className='grid_two_column'>
                <div className='image_section'>
                    <img src="https://ftechiz.com/wp-content/uploads/2022/07/about.jpg" alt='aim_image' />
                </div>
                <div className="content_section">
              <h1>Our Aim</h1>
              <p>"To provide extensive quality assurance leading your business to the next level.</p>
              <p>As a leading Software Development Company, we are trusted to solve complex problems with innovation and creativity.‚Äù</p>
              <NavLink>
                <Button> Contact Us</Button>
              </NavLink>
            </div>
            </div>
        </div>
    </Wrapper>
</>
  )
}
const Wrapper = styled.section`
  padding: 12rem 0 0 0 ;
  .grid_two_column{
    grid-template-columns:repeat(2, 1fr)
  }
  .image_section{
    img{
    border-radius:1rem;
        width:60rem;
        height:35rem;
        box-shadow:${({theme}) => theme.colors.dark_shadow};
    }
  }
  .content_section {
    h1 {
      color: ${({ theme }) => theme.colors.heading};

    }
    p {
      color: ${({ theme }) => theme.colors.heading};
      ${'' /* margin: 4rem; */}
      text-align: justify;
    }
  }
  `;
export default Our_Aim
